pragma solidity ^0.8.0;

import "./IERC20.sol";

contract testRebase { 

    //TODO: Update airdropped balance of tUSDC 
    //mapping(address => uint256) public airdroppedBal;
    //uint256 public timeLaunched;
    //uint256 deltaTimeFromInit;
    struct btonsLocked {  
        uint256 timeInit;  
        uint256 amounts;  
        }
    mapping(address => btonsLocked) public airdroppedBal;
    IERC20 public USDC;
    IERC20 public Bton;
    constructor(address _btonAddr) {
        USDC = IERC20(0xD7ACd2a9FD159E69Bb102A1ca21C9a3e3A5F771B);
        Bton = IERC20(_btonAddr);
        }

   
    function startAirDrop() external
    {
        airdroppedBal[msg.sender].timeInit = block.timestamp;
     //TODO: Check amount of BTON Held

    }

    function calcAirdrop() internal {
        uint256 deltaTimeFromInit;
        uint256 epochs;
        uint256 airdropAmt;
    deltaTimeFromInit = block.timestamp - airdroppedBal[msg.sender].timeInit;
    epochs = deltaTimeFromInit / 180; //test
    airdropAmt = epochs *1;
    airdroppedBal[msg.sender].amounts = airdropAmt;

    }
    function withdrawAirDrop() internal {

        uint256 amtWithdraw;
    
    airdroppedBal[msg.sender].amounts -= amtWithdraw;
    Bton.transferFrom(msg.sender,0x000000000000000000000000000000000000dEaD, amtWithdraw);

    }


}

